        },
        "condition": "{{parameters.input === 'url'}}"
    },
    {
        "url": "/",
        "method": "POST",
        "body": {
            "input": "base64",
            "outputformat": "{{parameters.outputFormat}}",
            "file": "{{base64(parameters.data)}}", //data is transformed to base64, because it's the only way it works on Convertio side.
            "filename": "{{parameters.filename}}" //replace file extension with outputformat
            //"options": "{{conversionOptions(parameters.pages, split(parameters.languages; ','))}}"   //doesn't really works as it should be based on Converio docs
        },
        "response": {
            "temp": {
                "id": "{{body.data.id}}"
            },
            "output": "{{body}}"
        },
        "condition": "{{parameters.input === 'data'}}"
    },
    {
        "url": "/{{temp.id}}/status", //checks operation status until the operation will be finished
        "method": "GET",
        "repeat": {
            "delay": 2500,
            "limit": 30,
            "condition": "{{temp.step_percent !== 100}}"
        },
        "response": {
            "valid": {
                "condition": "{{body.status !== 'failed'}}"
            },
            "temp": {
                "step_percent": "{{body.data.step_percent}}"
            }
        }
    },
    {
        "url": "/{{temp.id}}/dl", //downloads finished operation
        "method": "GET",
        "response": {
            "output": {
                "id": "{{body.data.id}}",
                "data": "{{decode(body.data.content)}}",
                "filesize": "{{length(decode(body.data.content))}}",
                "filename": "{{ifempty(rename(parameters.rename, parameters.outputFormat), ifempty(regexFilenameFromData(parameters.filename, parameters.outputFormat), parameters.filenameURL))}}"
            }
        },
        "condition": "{{temp.step_percent === 100}}"
    }
]

