addKey.code:
function addKey(body,key) {
	if(!body){
		obj = {
			"apikey": key
		}
		return obj
	}
	else{
		body = JSON.parse(body)
		body.apikey = key
		return body
	}
}

decode.code:
function decode(content) {
    //converts base64 content to Binary
    content = iml.toBinary(content, 'base64')
    return content
}

rename.code:
function rename(rename, outputFormat) {
    if(!rename) return
    newName = rename + '.' + outputFormat //adding a new file extension

    return newName
}

